const reactDescriptions = ['Fundamental', 'Crucial', 'Core']

function getRandomInt(max) {
  return Math.floor(Math.random() * (max + 1));
}

function Header() {
  return (
  <header>
    <img src="/logo192.png" alt="Stylized atom"/>
    <h1>React Essentials</h1>
    <p>
      {reactDescriptions[getRandomInt(2)]} React concepts you will need for almost any app 
      you are going to build!
    </p>
  </header>
  );
}

function App() {
  return (
    <div>
      <Header />
      <h2>Let's get started!</h2>
    </div>
  );
}

export default App;
